import React from "react";
import './Section8.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import Pathmodels from '../Section8/home1.jpg';
import Path from '../Section8/home2.jpg';
import Paths from '../Section8/home3.jpg';
function Section8(){
    return(
<div className="Section8-whole">
<Container className="Section8">

         <Row> <h2 className="clients">Caring is the new marketing</h2>
          <h5 className="client8">The Nextcent blog is the best place to read about
           the latest  membership insights, trends and more.
            See who's joining the community,read about how our community are 
            increasing their membership income and lot's more.â€‹</h5></Row>
            {/* <Row className="Section8-img">
        <Col sm={12}><img src={Pathmodels} alt="src" className="Section8-img"></img></Col>
        <Col sm={12}><img src={Path} alt="src" className="Section8-img"></img></Col>
        <Col sm={12}><img src={Paths} alt="src" className="Section8-img"></img></Col>
      </Row> */}
        <Row>
        <Col xs={6} md={4}><img src={Pathmodels} alt="src" className="Section8-img"></img></Col>
        <Col xs={6} md={6}><img src={Path} alt="src" className="Section8-img"></img></Col>
        <Col xs={6} md={4}><img src={Paths} alt="src" className="Section8-img"></img></Col>
        </Row>
</Container>
</div>
    );
}
export default Section8;
